    const resposta = await api.get('');
    console.log (resposta.data)

    this.setState({series:resposta.data})




  }

  render(){

    const{series}=this.state

    return(
      <div>
        <h1>Lista de series</h1>
        {console.log(series)}
        {series.map(serie=> (
          <li key={serie.id}></li>
        ))}
      </div>
    )
  }}


export default App;
